import React, { useState } from "react";
import MoviesCard from '../MoviesCard/MoviesCard';
import './MoviesCardList.css';

function MoviesList({ movieSearchResult, onLike, onDislike }) {

  console.log(movieSearchResult[0]);

  const [result, setResult] = useState([]);

  if (movieSearchResult.length > 0 ) {
    const parsedResult = JSON.parse(movieSearchResult);
    console.log(parsedResult[0]);

    for (let i = 0; i < parsedResult.length; i++) {
      if (i === 0) {
        setResult(parsedResult[i]);
      } else {
        setResult(result.push(parsedResult[i]));
      }

      console.log(`iteratio: ${parsedResult[i].nameRU}`)
    }

    console.log(`In MoviesList: result: ${result}`);
  }

  console.log(`In MoviesList: searchResults: ${movieSearchResult}`);


  //  

  return (
    <div className="movies-list">
      <div className="movies-list__container">
        {
          result.length > 0 &&
          result.map((movie) => {
            return <MoviesCard
              key={movie.movieId}
              movie={movie}
              onLike={onLike}
              onDislike={onDislike} />
          })
        }
      </div>

      <button 
        className="movies-list__button-more">
        Ещё
      </button>
    </div>

  )
}

export default MoviesList;
